import React from 'react';
import './lib/home.scss';
import LayoutHome from '../../layout/LayoutHome';
import Header from '../../common/skjheader/Header';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      slide: false,
      addClass: false
    };
  }

  render() {
    return (
      <div className="news page">
      <Header></Header>
       
      </div>
    );
  }
}
export default Home;
